import React from "react";
import "./styles/Button.css";

function Button({ variant, children, color, action, size }) {
  const class_list = `${variant} ${size} ${color}`;
  return (
    <button className={class_list} onClick={action}>
      {children}
    </button>
  );
}

export default Button;
